import React, { Component } from 'react';
import ScrollAnimation from 'react-animate-on-scroll';

export default class Describe extends Component {
    render() {
        return (
            <article className="Describe" id="Me">
                <ScrollAnimation animateIn="flipInY" animate="flipOutY">
                    <p>Bonjour, je m'appelle Christophe. Infographiste de par ma scolarité (et première passion), je me suis lancé dans une formation Web Developer depuis peu. Durant cette formation, j'ai appris plusieurs langages de programmation</p>
                </ScrollAnimation>
            </article>
        );
    }
}
